			spawn_player('invisible_observer', level.player.mid_x, level.player.mid_y, 1, 
				[set(child._player, level.player),
				set(child._target_object, 'return_target'),
				set(child._target_level,'milgrams-basement-junction.cfg'),
				
				schedule(1, child.eval_and_exec(q(
